window.bookSummaryJSON = "<p><b>The right direction is where the foes are.</b><br> <br> Good advice in general, but even better when foes are a valuable resource.<br> <br> Sylver had faced and defeated goblins, large rats, giants, wolves, bandits, demon worshipers, apes, weird lizards, fish people, and even fellow undead.<br> <br> He also managed to rid his city of a <b><i>[Hero]</i></b> without destroying half the city in the process.<br> <br> And now he was going was to face a rebellion, an uppity investigator, a foreign sun, and weapons he hoped he would never have to see, let alone fight against.<br> <br> <b>Book three of this Fantasy LitRPG Series about a reincarnated necromancer growing in power and finding his way in a new world where the rules have changed vastly since he last \"lived.\"<br> <br> About the series: </b>With equal parts humor and dark sorcery action, expect loads of skill progression, deep worldbuilding, and unforgettable characters in this story which had nearly 10 million views on Royal Road. Now completely revised and re-edited for Kindle &amp; Audible.</p>"; 
